import React, { Component } from "react";
import { _login } from "./../../util/req.js";
import { withRouter } from "react-router-dom";
import dayjs from "dayjs";



function gettimes() {
  var arr = []
  for (let index = 0; index < 10; index++) {
    var hs = dayjs().subtract(index, 'hours').format("YYYYMMDD-HHmm")
    var h = hs.slice(0, 11)
    var ms = hs.slice(11, 13)
    var m = Number(ms) - (Number(ms) % 15)

    while (m > 0) {
      m -= 15;
      arr.push(hs + m)
    }
  }
  console.log(arr)
}
gettimes()


// 20210425-0315
var getdaytimes = dayjs().format("YYYYMMDD-HHmm").slice(11, 13)






class Login extends Component {
  constructor() {
    super();
    this.state = {
      username: "a123",
      password: "123456",
    };
  }

  handleChange = (e, type) => {
    this.setState({
      [type]: e.target.value,
    });
  };

  loginHandle = async () => {
    const obj = {
      username: this.state.username,
      password: this.state.password,
    };
    console.log("obj -> :", obj);

    const res = await _login(obj);
    this.successHandle(res.data);
  };

  successHandle = (data) => {
    localStorage.setItem("user", JSON.stringify(data));
    this.props.history.push(data.role === "1" ? "/index/home" : "/index/user");
  };
  render() {
    return (
      <div>
        username ：
        <input
          value={this.state.username}
          onChange={(e) => this.handleChange(e, "username")}
        />
        <br />
        password ：
        <input
          value={this.state.password}
          onChange={(e) => this.handleChange(e, "password")}
        />
        <br />
        <button onClick={this.loginHandle}>Login</button>
      </div>
    );
  }
}

export default withRouter(Login);
